<?php
defined('BASEPATH') or exit('No direct script access allowed');

class Seeder extends CI_Controller
{

    public function villa()
    {
        for ($i = 0; $i < 100; $i++) {
            $data = [
                'villa_nama'      => 'Villa ' . $i,
                'villa_lokasi'      => 'Lokasi ' . rand(1, 10),
                'villa_harga'      => rand(5000000, 15000000),
                'villa_deskripsi'      => 'Deskripsi ke- ' . $i,
                'villa_kontak'      => '0812' . rand(0000000, 999999),
                'villa_kapasitas'      => rand(20, 50),
                'villa_gambar'       => 'data:image/jpeg;base64,'
            ];
            $this->db->insert('tb_villa', $data);
        }

        echo 'Berhasil membuat ' . $i . ' data produk';
    }
}
